const eventsService = {
	methods: {
		getEventsByDateAndGeoLocation: (date, lat, lng) => {
            return new Promise(function(resolve, reject){
                if(date.getDay() % 2 ==0){
                    var results = [events[0], events[1]]
                    resolve(results)
                }
                else{
                    resolve(events)
                }
            })
        },
        getEventById: (eventId) => {
            return new Promise(function(resolve, reject){
                let currentEvent = events.find((e)=> e.id == eventId);
                if(currentEvent)
                    resolve(currentEvent);
                reject('no element was found')
            })
        }	
	}
}

export default eventsService